107.body:
🤓 Tato sekce obsahuje doplňující učivo. Pokud je toho na vás moc, můžete ji prozatím přeskočit a vrátit se k ní později. Občas můžeme chtít v programech použít stejnou hodnotu na více místech. V takovém případě se hodí danou hodnotu pojmenovat, aby bylo zřejmé, co reprezentuje. Zároveň by bylo užitečné ji nadefinovat pouze na jednom místě, abychom její hodnotu mohli jednoduše upravit bez toho, abychom při tom museli upravovat všechna místa, kde danou hodnotu používáme. Pomocí příkazu #define <název> <hodnota> můžeme vytvořit makro ( macro ) s daným názvem a hodnotou. Pokud preprocesor v kódu od řádku s #define do konce zdrojového souboru narazí na název makra, tak tento název nahradí hodnotou makra (opět se jedná o prosté textové nahrazení, tedy Ctrl+C -> Ctrl+V). Zkuste si například, co vypíše tento program: #include <stdio.h> #define CENA 25 int main() { printf("Cena je %d\n", CENA); printf("Dvojnasobek ceny je %d\n", CENA * 2); return 0;
} Představte si, že hodnotu tohoto makra používáme v programu na stovkách míst. Pokud bychom ji potřebovali změnit, tak stačí změnit jeden řádek s #define a preprocesor se poté postará o to, že se hodnota aktualizuje na všech použitých místech. Makra jsou dle konvence obvykle pojmenována s "caps-lockem", tedy velkými písmeny (respektive stylem screaming snake case ). Je třeba brát na vědomí, že preprocesor opravdu dělá pouhé textové nahrazení. Například následující kód tak nedává smysl: #define CENA 25
int main() { CENA = 0; return 0;
} protože po spuštění preprocesoru se z něj stane tento (nesmyslný) kód: int main() { 25 = 0; return 0;
}

108.body:
Makra mohou také obsahovat parametry: #define <název_makra>(<param1>, <param2>, …) <hodnota_makra> Tyto parametry můžete použít pro definici hodnoty. Nicméně je opět třeba dát pozor na to, že preprocesor pracuje pouze s textem, nerozumí jazyku C . Parametry tak jsou předávány čistě jako text, je tak potřeba dávat si pozor na několik věcí: Priorita operátorů Pokud bychom chtěli vytvořit například makro pro výpočet druhé mocniny, můžeme ho napsat takto: #define MOCNINA(a) a * a Pokud však takovéto makro použijeme s nějakým komplexním výrazem, nemusíme dosáhnout kýženého výsledku kvůli priority operátorů: #include <stdio.h> #define MOCNINA(a) a * a int main() { printf("%d
", MOCNINA(1 + 1)); return 0;
} Řádek s printf totiž preprocesor změní na printf("%d
", 1 + 1 * 1 + 1);, což jistě není to, co jsme chtěli. Proto je dobré při použití maker s parametry obalovat jednotlivé parametry závorkami: #define MOCNINA(a) (a) * (a) Pak by zde již došlo k úpravě na printf("%d
", (1 + 1) * (1 + 1));, což vrátí druhou mocninu hodnoty 1 + 1, tedy 4. Vedlejší efekty Pokud mají argumenty předávané do makra nějaké vedlejší efekty , je třeba si dávat pozor na to, že makro může jednoduše takovýto argument rozkopírovat a tím pádem vedlejší efekt provést vícekrát. Například při použití makra MOCNINA výše by zde došlo k dvojnásobené inkrementaci proměnné x: #include <stdio.h> #define MOCNINA(a) a * a int main() { int x = 0; int mocnina = MOCNINA(x++); printf("x=%d, mocnina=%d
", x, mocnina); return 0;
} Do maker tak radši nedávejte argumenty, které způsobují vedlejší efekty. Cvičení : Zamyslete se nad tím, jaké hodnoty vypsal program s makrem s vedlejšími efekty výše. Zkuste si rozepsat makro a odsimulovat v hlavě běh programu. Dojdete ke stejnému výsledku?

117.body:
Jelikož před spuštěním programu nevíme, na jaké adrese budou uloženy hodnoty, které nás budou zajímat, tak obvykle nedává smysl inicializovat ukazatel na konkrétní adresu (např. int* p = 5;). Pro inicializaci ukazatele tak existuje několik standardních možností: Inicializace na nulu Pokud chceme vytvořit "prázdný" ukazatel, který zatím neukazuje na žádnou validní adresu, tak se dle konvence inicializuje na hodnotu 0. Takovému ukazateli se pak říká nulový ukazatel ( null pointer ). Jelikož datový typ výrazu 0 je int, tak před přiřazením této hodnoty do ukazatele jej musíme přetypovat na datový typ cílového ukazatele: float* p = (float*) 0; Jelikož tento typ inicializace je velmi častý, standardní knihovna C obsahuje makro NULL, které konverzi nuly na ukazatel provede za vás. Můžete jej najít například v souboru stdlib.h: #include <stdlib.h>
// ...
float* p = NULL; Využití alokační funkce Pokud budete alokovat paměť manuálně , tak použijete funkce, které vám vrátí adresu jako svou návratovou hodnotu. Využití operátoru adresy Pokud chcete ukazatel nastavit na adresu již existující hodnoty v paměti, můžete použít operátor adresy ( address-of operator ). Ten má syntaxi &<proměnná>. Tento operátor se vyhodnotí jako adresa předané proměnné [3] : #include <stdio.h> int main() { int x = 1; int* p = &x; printf("%d\n", x); // hodnota proměnné x printf("%p\n", p); // adresa v paměti, kde je uložena proměnná x return 0;
} Výraz předaný operátoru & se musí vyhodnotit na něco, co má adresu v paměti (většinou to bude proměnná ). Nedává tedy smysl použít něco jako &5, protože 5 je číslo, které nemá samo o sobě žádnou adresu v paměti. Při použití tohoto operátoru je také třeba dávat si pozor na to, aby hodnota v paměti, jejíž adresu použitím & získáme, stále existovala, když se budeme později snažit k této adrese pomocí ukazatele přistoupit. V opačném případu by mohlo dojít k paměťové chybě 💣. Všimněte si, že pro výpis ukazatelů ve funkci printf se používá %p místo %d.

118.body:
Když už máme v ukazateli uloženou nějakou (validní) adresu v paměti, tak k této paměti můžeme přistoupit pomocí operátoru dereference . Ten má syntaxi *<výraz typu ukazatel>. Při použití tohoto operátoru na ukazateli program přečte adresu v ukazateli, podívá se do paměti a načte hodnotu uloženou na této adrese. Podle toho, na jaký datový typ ukazatel ukazuje, se načte odpovídající počet bytů z paměti: #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; printf("%p\n", ukazatel); printf("%d\n", *ukazatel); printf("%d\n", cislo); return 0;
} V tomto programu se do proměnné ukazatel uloží adresa proměnné cislo, a poté dojde k načtení hodnoty (*ukazatel) této proměnné z paměti přes adresu uloženou v ukazateli. Interaktivní vizualizace kódu Pokud chceme do adresy uložené v ukazateli naopak nějakou hodnotu zapsat, tak můžeme operátor dereference použít také na levé straně operátoru zápisu . Uhodnete, co vypíše tento program? #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; *ukazatel = 5; printf("%d\n", cislo); return 0;
} Interaktivní vizualizace kódu Pokud provádíte operace s přímo s proměnnou ukazatele, budete vždy pracovat "pouze" s adresou, která je v něm uložena. Pokud chcete načíst nebo změnit hodnotu, která v paměti leží na adrese uložené v ukazateli, musíte použít operátor dereference. Pozor na rozdíl mezi * používanou pro deklaraci datového typu ukazatel, operátorem dereference a operátorem násobení. Všechny tyto věci sice používají hvězdičku, ale jinak spolu nesouvisí. Vždy záleží na kontextu, kde jsou tyto znaky použity: // hvězdička říká, že datový typ proměnné `p` je ukazatel na `int`
int* p; // hvězdička provede dereferenci návratové hodnoty funkce `vrat_ukazatel`
int x = *vrat_ukazatel(); // hvězdička provede násobení dvou čísel
int a = 5 * 6;

119.body:
Abychom se mohli v paměti "posouvat" o určitý kus dopředu či dozadu (relativně k nějaké adrese), můžeme k ukazatelům přičítat či odčítat čísla. Toto se označuje jako aritmetika s ukazateli ( pointer arithmetic ). Tato aritmetika má důležité pravidlo – pokud k ukazateli na konkrétní datový typ přičteme hodnotu n, tak se adresa v ukazateli zvýší o n-násobek velikosti datového typu, na který ukazatel ukazuje. Při aritmetice s ukazateli se tak neposouváme po jednotlivých bytech, ale po celých hodnotách daného datového typu [4] . Z toho vyplývá, že aritmetiku nemůžeme provádět nad ukazateli typu void*, protože ty neukazují na žádný konkrétní datový typ. Například, pokud bychom měli ukazatel int* p s hodnotou 16 (tj. "ukazuje" na adresu 16) a velikost intu by byla 4, tak výraz p + 1 bude ukazatel s hodnotou 20, výraz p + 2 bude ukazatel s adresou 24 atd. Je důležité rozlišovat , jestli při použití sčítání/odčítání pracujeme s hodnotou ukazatele anebo s hodnotou na adrese, která je v ukazateli uložena: int x = 1;
int* p = &x; *p += 1; // zvýšili jsme hodnotu na adrese v `p` (tj. proměnnou `x`) o `1`
p += 1; // zvýšili jsme adresu v `p` o `4` (tj. p nyní už neukazuje na `x`) K čemu je aritmetika s ukazateli užitečná se dozvíte v sekci o práci s více proměnnými zároveň . Kromě dereference a aritmetiky lze s ukazateli provádět také porovnávání (klasicky pomocí operátoru ==). Díky tomu můžeme zjistit, jestli se dvě adresy rovnají.

120.body:
Jak se dozvíte v následující sekci , ukazatele jsou nezbytné pro dynamickou alokaci paměti. Hodí se také při práci s více proměnnými zároveň. Kromě toho je ale lze použít také například v následujících situacích, které všechny souvisí s předáváním adres (ukazatelů) do funkcí: Změna vnějších hodnot zevnitř funkce Hodnoty argumentů předávaných při volání funkcí se do funkce kopírují, nelze tak jednoduše zevnitř funkce měnit hodnoty proměnných, které existují mimo danou funkci. To je sice samo o sobě vhodná vlastnost, protože pokud bude funkce měnit pouze své lokální proměnné, případně parametry, tak bude jednodušší se v ní vyznat. Nicméně, někdy opravdu chceme ve funkci změnit hodnoty externích proměnných. Toho můžeme dosáhnout tak, že si do funkce místo hodnoty proměnné pošleme její adresu v ukazateli, a pomocí této adresy pak hodnotu proměnné změníme. Takto například můžeme vytvořit funkci, která vezme adresy dvou proměnných a prohodí jejich hodnoty: #include <stdio.h>
void vymen(int* a, int* b) { int docasna_hodnota = *a; *a = *b; *b = docasna_hodnota;
}
int main() { int x = 5; int y = 10; vymen(&x, &y); printf("Po prehozeni: x=%d, y=%d\n", x, y); return 0;
} Interaktivní vizualizace kódu Vrácení více návratových hodnot Posílání adres proměnných do funkce můžeme využít také k tomu, abychom z funkce vrátili více než jednu návratovou hodnotu (do adres uložených v parametrech totiž můžeme zapsat "návratové" hodnoty). Toho bychom však měli využívat pouze, pokud je to opravdu nezbytné. Takovéto funkce je totiž složitější volat a nejsou čisté , protože obsahují vedlejší efekt - mění externí stav programu. #include <stdio.h> void vrat_dve_hodnoty(int* a, int* b) { *a = 5; *b = 6;
} int main() { int a = 0; int b = 0; vrat_dve_hodnoty(&a, &b); printf("a=%d, b=%d\n", a, b); return 0;
} Sdílení hodnot bez kopírování Pokud bychom měli proměnné, které v paměti zabírají velké množství bytů (například struktury ), a předávali je jako argumenty funkci, tak může být zbytečně pomalé je pokaždé kopírovat. Pokud do funkce pouze předáme jejich adresu, tak dojde ke kopii pouze jednoho čísla s adresou, nezávisle na tom, jak velká je proměnná, která je na dané adrese uložena. Ukazatele tak můžeme použít ke sdílení hodnot v paměti mezi funkcemi bez toho, abychom je kopírovali.

126.body:
Pokud chcete nastavit do ukazatele na funkci nějakou hodnotu, stačí do něj přiřadit název existující funkce. int funkce(int x) { return x + 1;
} int main() { int (*ukazatel)(int) = funkce; return 0;
} Signature přiřazené funkce musí odpovídat datovému typu ukazatele, nelze tak například přiřadit funkci, která nic nevrací, do ukazatele, který má signaturu int (*)(). Jakmile máme v proměnné ukazatele na funkci uloženou adresu nějaké funkce, můžeme pomocí názvu této proměnné danou funkci zavolat. #include <stdio.h> int funkce(int x) { printf("Funkce zavolana s parametrem %d\n", x); return x + 1;
} int main() { int (*ukazatel)(int) = funkce; int ret = ukazatel(1); printf("Funkce vratila %d\n", ret); return 0;
}

127.body:
K čemu vlastně ukazatel na funkce může sloužit? Už víme, že pomocí funkcí můžeme parametrizovat kód, což nám umožňuje používat identický kód nad různými vstupními hodnotami bez toho, abychom tento kód museli neustále duplikovat. Prozatím jsme pro parametrizaci používali pouze jednoduché hodnoty, jako čísla nebo pravdivostní hodnoty. Pomocí ukazatelů na funkce však můžeme parametrizovat samotný kód, který se má uvnitř nějaké funkce provést. Představte si například, že chcete vytvořit funkci, která provede nějakou operaci (např. přičtení konstanty, vynásobení konstantou nebo vypsání na výstup) s číslem, ale pouze v případě, že toto číslo je kladné. V opačném případě by měla funkce toto číslo pouze vrátit, bez jakékoliv změny. Jak byste tuto funkci napsali, bez toho, abyste ji duplikovali pro každou operaci, která se má s kladným číslem provést? První řešení by mohlo vypadat například takto: #include <stdio.h> int proved_pro_kladne(int cislo, int operace) { if (cislo <= 0) return cislo; if (operace == 0) { return cislo * 3; } else if (operace == 1) { return cislo + 1; } else { printf("Cislo: %d
", cislo); return cislo; }
} int main() { printf("%d
", proved_pro_kladne(-1, 0)); printf("%d
", proved_pro_kladne(1, 0)); printf("%d
", proved_pro_kladne(1, 1)); printf("%d
", proved_pro_kladne(1, 2)); return 0;
} Toto řešení jistě bude fungovat, nicméně je dost nepraktické, protože musíme ve funkci proved_pro_kladne dopředu vyjmenovat všechny možné operace, které lze s číslem provést. Pokud bychom tak chtěli přidat novou operaci, budeme muset tuto funkci upravit. Zároveň je také dost nepřehledné předávat funkci informaci o tom, jaká operace se má provést, pomocí proměnné typu int (parametr operace). Pomocí ukazatele na funkci můžeme funkci proved_pro_kladne předat kód [2] , který se má provést, pokud je předané číslo kladné. Pomocí toho můžeme od sebe oddělit logiku naší funkce (kontrola, jestli je číslo kladné či ne) a samotnou operaci, která se má provést s kladným číslem. Pokud tak vytvoříme novou operaci, nemusíme funkci proved_pro_kladne jakkoliv upravovat, stačí ji zavolat s jiným argumentem. Ve formě adresy funkce. #include <stdio.h> int proved_pro_kladne(int cislo, int(*operace)(int)) { if (cislo <= 0) return cislo; return operace(cislo);
} int vynasob_dvema(int cislo) { return cislo * 2; }
int pricti_jednicku(int cislo) { return cislo + 1; }
int vypis(int cislo) { printf("Cislo: %d
", cislo); return cislo;
} int main() { printf("%d
", proved_pro_kladne(-1, vynasob_dvema)); printf("%d
", proved_pro_kladne(1, vynasob_dvema)); printf("%d
", proved_pro_kladne(1, pricti_jednicku)); printf("%d
", proved_pro_kladne(1, vypis)); return 0;
} Ukazatele na funkce nám umožňují vytvářet kód, který je více composable , jinak řečeno lze do sebe skládat jako kostky Lega a nenutí nás zadrátovat možné způsoby použití dopředu (jako tomu bylo v prvním řešení s parametrem int operace). Ještě užitečnější jsou ukazatele na funkci v kombinacemi se zpracováním více hodnot pomocí polí , kdy můžeme napsat obecnou funkci, která nějak zpracovává pole, a předat jí například ukazatel na funkci, která se má zavolat nad každým prvkem v poli. Hodí se také při práci se strukturami , kdy můžeme do atributu struktury uložit ukazatel na funkci a přidat tak individuální chování k různým hodnotám struktur.

130.body:
Parametr size udává, kolik bytů paměti se má naalokovat. Tuto velikost můžeme "tipnout" manuálně, nicméně to není moc dobrý nápad, protože bychom si museli pamatovat velikosti datových typů (přičemž jejich velikost se může lišit v závislosti na použitém operačním systému či překladači!). Abychom tomu předešli, tak můžeme použít operátor sizeof, kterému můžeme předat datový typ [2] . Tento výraz se poté vyhodnotí jako velikost daného datového typu: #include <stdio.h>
int main() { printf("Velikost int je: %lu\n", sizeof(int)); printf("Velikost int* je: %lu\n", sizeof(int*)); return 0;
} Případně výraz, v tom případě si sizeof vezme jeho datový typ. Návratový typ void* reprezentuje ukazatel na libovolná data. Funkce malloc musí fungovat pro alokaci libovolného datového typu, proto musí mít jako návratový typ právě univerzální ukazatel void*. Při zavolání funkce malloc bychom měli tento návratový typ přetypovat na ukazatel na datový typ, který alokujeme. Při zavolání mallocu dojde k naalokování size bytů na haldě. Adresa prvního bytu této naalokované paměti se poté vrátí jako návratová hodnota mallocu. Zde je ukázka programu, který naalokuje paměť pro jeden int ve funkci, adresu naalokované paměti poté vrátí jako návratovou hodnotu a naalokovaná paměť je poté přečtena ve funkci main: #include <stdlib.h> int* naalokuj_pamet() { int* pamet = (int*) malloc(sizeof(int)); *pamet = 5; return pamet; }
int main() { int* pamet = naalokuj_pamet(); printf("%d\n", *pamet); return 0;
} Interaktivní vizualizace kódu

137.body:
Hodnota zadaná v hranatých závorkách by měla být konstantní (tj. buď přímo číselná hodnota anebo konstantní proměnná ). Pokud budete potřebovat pole dynamické velikosti, tak byste měli použít dynamickou alokaci paměti . Jazyk C od verze C99 již sice povoluje dávat do hranatých závorek i "dynamické" hodnoty, tj. výrazy, jejichž hodnota nemusí být známa v době překladu: int velikost = ...; // velikost se načte např. ze souboru
int pole[velikost]; Nicméně tuto funkcionalitu raději nepoužívejte. Zásobník má značně omezenou velikost a není určen pro alokaci velkého množství paměti [3] . Pokud navíc velikost takovéhoto pole může ovlivnit uživatel programu (např. zadáním vstupu), může váš program jednoduše "shodit", pokud by zadal velké číslo a došlo by k pokusu o vytvoření velkého pole na zásobníku. Zkuste se tak vyvarovat používání dynamických hodnot při vytváření polí na zásobníku. Můžete si například zkusit přeložit následující program: int main() { int pole[10000000]; return 0;
} Při spuštění by měl program selhat na paměťovou chybu , i když váš počítač má pravděpodobně více než 10000000 * 4 (cca 38 MiB) paměti. Pokud chcete alokovat více než několik stovek bytů, použijte raději dynamickou alokaci na haldě.

140.body:
Abychom využili toho, že nám pole umožňují vytvořit větší množství paměti najednou, musíme mít možnost přistupovat k jednotlivým prvkům v poli. K tomu můžeme využít ukazatelů . Proměnná pole se totiž chová jako ukazatel na první prvek (prvek na nultém indexu!) daného pole, pomocí operátoru dereference tak k tomutu prvku můžeme jednoduše přistoupit: #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *pole); return 0;
} Abychom přistoupili i k dalším prvkům v poli, tak můžeme využít aritmetiky s ukazateli . Pokud chceme získat adresu prvku na i-tém indexu, stačí k ukazateli na první prvek přičíst i [4] : #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *(pole + 0)); // první prvek pole printf("%d
", *(pole + 1)); // druhý prvek pole printf("%d
", *(pole + 2)); // třetí prvek pole return 0;
} Všimněte si, že při použití operátoru dereference zde používáme závorky. Je to z důvodu priority operátorů . Výraz *pole + 2 by se vyhodnotil jako první prvek z pole pole plus 2, protože * (dereference) má větší prioritu než sčítání. Nyní už možná tušíte, proč se při práci s poli vyplatí počítat od nuly. Prvek na nultém indexu je totiž vzdálen nula prvků od začátku pole. Prvek na prvním indexu je vzdálen jeden prvek od začátku pole atd. Pokud bychom indexovali od jedničky, museli bychom při výpočtu adresy relativně k ukazateli na začátek pole vždy odečíst jedničku, což by bylo nepraktické. Přistupování k prvkům pole se běžně označuje pojmem indexování pole .

141.body:
Jelikož je operace přístupu k poli ("posunutí" ukazatele a jeho dereference) velmi běžná (a zároveň relativně krkolomná), C obsahuje speciální operátor, který ji zjednodušuje. Tento operátor se nazývá array subscription operator a má syntaxi <výraz a>[<výraz b>] Slouží jako zkratka [5] za výraz *(<výraz a> + <výraz b>) Příklad: pole[0] je ekvivalentní výrazu *(pole + 0) pole[5] je ekvivalentní výrazu *(pole + 5) int pole[3] = { 1, 2, 3 };
pole[0] = 5; // nastavili jsme první prvek pole na hodnotu `5`
int c = pole[2]; // nastavili jsme `c` na hodnotu posledního (třetího) prvku pole Takovéto "zkratky", které v programovacím jazyku nepřináší novou funkcionalitu, pouze zkracují či zjednoduššují často používané kombinace příkazů, se označují jako syntactic sugar . Jelikož je používání hranatých závorek přehlednější než používání závorek a hvězdiček, doporučujeme je používat pro přistupování k prvkům pole, pokud to půjde. Pozor na rozdíl mezi tímto operátorem a definicí pole. Obojí sice používá hranaté závorky, ale jinak spolu tyto dvě věci nesouvisejí. Podobně jako se * používá pro definici datového typu ukazatele a zároveň jako operátor dereference (navíc i jako operátor pro násobení). Vždy záleží na kontextu, kde jsou tyto znaky použity.

144.body:
Už víme, že když předáváme argumenty do funkcí, tak se jejich hodnota zkopíruje. U statických polí tomu tak ovšem není, protože pole můžou být potenciálně velmi velká a provádění kopií polí by tak potenciálně mohlo brzdit provádění programu. Když tak použijeme proměnnou pole jako argument při volání funkce, dojde k tzv. konverzi pole na ukazatel ( array to pointer decay ). Pole se tak vždy předá jako ukazatel na jeho první prvek: #include <stdio.h> void vypis_pole(int* pole) { printf("%d\n", pole[0]);
} int main() { int pole[3] = { 1, 2, 3 }; vypis_pole(pole); return 0;
} Pro parametry sice můžete použít datový typ pole: void vypis_pole(int pole[3]) { ... } nicméně i v tomto případě se bude takovýto parametr chovat stejně jako ukazatel (v tomto případě tedy int*). Navíc překladač ani nebude kontrolovat, jestli do takového parametru opravdu dáváme pole se správnou velikostí. Pro parametry reprezentující pole tak raději rovnou používejte ukazatel.

145.body:
Když ve funkci přijmeme jako parametr ukazatel na pole, tak nevíme, kolik prvků v tomto poli je. Tato informace je ale stěžejní, bez ní totiž nevíme, ke kolika prvkům pole si můžeme dovolit přistupovat. Pokud tedy ukazatel na pole předáváme do funkce, je obvykle potřeba zároveň s ním předat i délku daného pole: int secti_pole(int* pole, int velikost) { int soucet = 0; for (int i = 0; i < velikost; i++) { soucet += pole[i]; } return soucet;
} Výpočet velikosti pole Abyste při změně velikosti statického pole nemuseli ručně jeho velikost upravovat na více místech v kódu, tak můžete ve funkci, kde definujete statické pole, vypočítat jeho velikost pomocí operátoru sizeof: int pole[3] = { 1, 2, 3 };
printf("Velikost pole v bytech: %lu\n", sizeof(pole)); Abyste zjistili počet prvků ve statickém poli, můžete velikost v bytech vydělit velikostí každého prvku v poli: int pole[3] = { 1, 2, 3 };
printf("Pocet prvku v poli: %lu\n", sizeof(pole) / sizeof(pole[0])); Operátor sizeof bude pro toto použití fungovat pouze pro statické pole a pouze ve funkci, ve které statické pole vytváříte! Pokud pole pošlete do jiné funkce, už z něj bude pouze ukazatel, pro který sizeof vrátí velikost ukazatele (což bude na vašem PC nejspíše 8 bytů).

150.body:
Při práci s dvourozměrným polem bychom chtěli pracovat s dvourozměrným indexem (řádek i, sloupec j), nicméně při samotném přístupu do paměti pak musíme tento vícerozměrný index převést na 1D index. A naopak, z 1D indexu bychom chtěli mít možnost získat zpět 2D index. Pro výpočet indexů 2D pole s vyska řádky a sirka sloupci můžeme použít tyto jednoduché vzorce: Převod z 2D do 1D - abychom se dostali na cílovou pozici, musíme přeskočit radek řádků, kde každý řádek má sirka prvků, a poté ještě musíme přičíst pozici sloupce (sloupec). int index_2d_na_1d(int radek, int sloupec, int sirka) { return radek * sirka + sloupec;
} Převod z 1D do 2D - pro převod z 1D indexu zpět na 2D index stačí aplikovat opačný postup. Nejprve vydělíme 1D index počtem sloupců, abychom zjistili, na jakém jsme řádku, a poté použijeme zbytek po dělení, abychom zjistili, na jakém jsme sloupci. void index_1d_na_2d(int index, int sirka, int* radek, int* sloupec) { *radek = index / sirka; *sloupec = index % sloupec;
} Tento koncept lze zobecnit na libovolně rozměrné pole (3D, 4D, …).

162.body:
Vytváření řetězců tímto způsobem je nicméně celkem zdlouhavé a nepřehledné. Často chceme v programu jednoduše a rychle zapsat krátký textový řetězec tak, aby šel přehledně přečíst. K tomu můžeme využít tzv. řetězcový literál ( string literal ), který lze vytvořit tak, že napíšeme text do dvojitých uvozovek ("). Pokud tedy v našem programu vytvoříme například literál "UPR", tak se stane následující: Překladač při překladu uloží do výsledného spustitelného souboru pole reprezentující daný řetězec. V tomto případě půjde o pole velikosti 4 s hodnotami 'U', 'P', 'R' a '\0'. Při spuštění programu se toto pole načte do globální paměti v sekci adresního prostoru, která je určena pouze pro čtení. Do takto vytvořeného řetězce tak nelze zapisovat, lze jej pouze číst [2] . Samotný výraz literálu se při běhu programu vyhodnotí jako adresa prvního znaku řetězce uloženého v globální paměti. Datový typ literálu bude ukazatel na konstantní znak , tedy const char*. Tento datový typ říká, že hodnotu znaku na dané adrese nelze měnit. Tyto řetězce jsou pouze pro čtení zejména z toho důvodu, aby je šlo sdílet. Pokud například v programu použijete třikrát stejný řetězcový literál, překladač může v paměti pole pro tento literál vytvořit pouze jednou, aby ušetřil paměť. Kvůli toho ale musí být řetězce pouze pro čtení, pokud bychom totiž takto sdílený řetězec změnili, změnilo by to i hodnotu všech ostatních literálů, které se vyhodnotí na jeho adresu, což by bylo dost neintuitivní. Pomocí řetězcového literálu si tak můžeme značne usnadnit zápis řetězců v programech, jelikož nemusíme přemýšlet nad délkou pole, nemusíme pamatovat na umístění znaku '\0' na konec řetězce a ani nemusíme obalovat jednotlivé znaky do apostrofů: #include <stdio.h> int main() { const char* text = "UPR"; printf("%s\n", text); return 0;
} Je však třeba pamatovat na to, že takto vytvořené řetězce jsou opravdu pouze pro čtení, a nesmíme tak do nich zapisovat. Pokud je budete ukládat do proměnné, tak použijte datový typ const char*, díky kterému vás překladač bude hlídat, abyste se do takovéhoto řetězce omylem nesnažili něco zapsat. Pokud byste chtěli použít řetězcový literál pro vytvoření řetězce, který lze měnit, můžete ho uložit do proměnné typu char[] (tj. pole znaků): #include <stdio.h> int main() { char text[] = "UPR"; text[0] = 'A'; printf("%s\n", text); return 0;
} V takovémto případě se hodnota z literálu překopíruje do proměnné pole znaků na zásobníku. Pokud jsou vám řetězcové literály povědomé, je to kvůli toho, že jsme je již mnohokrát využili při volání funkce printf. Víceřádkové řetězcové literály Pokud budete chtít zapsat řetězcový literál na více řádků kódu, můžete buď na konci každého neukončeného řádku použít znak \: const char* veta = "Ahoj \
jmenuji \
se \
Karel"; nebo každý řádek samostatně obalit uvozovkami: const char* veta = "Ahoj"
"jmenuji"
"se"
"Karel"; Pozor však na to, že v ani jednom ze zmíněných případů nebude součástí řetězce znak odřádkování. Ten musíte vždy přidat explicitně: const char* radky = "radek1\n\
radek2\n\
radek3\n"; // nebo
const char* radky = "radek1\n"
"radek2\n"
"radek3\n";

163.body:
U polí je trochu nepraktické to, že pokud je chceme poslat do nějaké funkce, musíme spolu s ukazatelem na první prvek pole předat také jeho velikost , aby funkce věděla, ke kolika prvkům si může dovolit přistoupit. Jiným způsobem, jak určit velikost pole, je zvolit si speciální hodnotu, která bude značit konec pole. Když kód, který s takovýmto polem bude pracovat, na tuto speciální hodnotu narazí, tak bude vědět, že dále v paměti již pole nepokračuje. Tento mechanismus je využit právě u řetězců zakončených nulou, kde onou speciální hodnotou je právě tzv. NUL znak, který má číselnou hodnotu 0. Například při procházení řetězce v cyklu tak nemusíme dopředu znát jeho délku, stačí cyklus ukončit, jakmile narazíme na znak '\0'. Například funkce pro spočtení délky řetězce by mohla vypadat takto [3] : int delka_retezce(const char* retezec) { int delka = 0; // dokud není znak na adrese v ukazateli roven znaku NUL while (*retezec != '\0') { delka = delka + 1; retezec = retezec + 1; // posuň ukazatel o jeden znak dále } return delka;
} Tato funkce postupně projde všechny znaky řetězce a počítá, kolik jich je, dokud nenarazí na znak '\0. Pro procházení řetězce je zde použita aritmetika s ukazateli . Všimněte si, že tato funkce bere ukazatel na konstantní pole znaků. Pokud ve funkci nepotřebujete měnit hodnoty pole, je obvykle dobrý nápad použít klíčové slovo const před datovým typem obsaženým v poli, aby vás překladač ohlídal, že se pole nesnažíte měnit. Do takovéto funkce pak klidně můžete poslat i pole, které ve skutečnosti měnit lze, jinak řečeno např. char* lze bez problému převést na const char*. V opačném směru konverze není korektní. Z toho vyplývá mimo jiné to, že znak NUL nemůže být použit "uprostřed" řetězce. Pokud by tomu tak bylo, tak funkce, které by s takovýmto řetězcem pracovaly, by při nalezení tohoto znaku přestaly řetězec zpracovávat, a jakékoliv další znaky za NUL by byly ignorovány. Uhodnete tak, co vypíše následující program? #include <stdio.h> int main() { char text[] = {'U', '\0', 'P', 'R', '\0'}; printf("%s\n", text); return 0;
}

165.body:
Standardní knihovna C obsahuje řadu funkcí , které umí s řetězci zakončenými nulou pracovat. Zde je seznam několika vybraných funkcí, které pro vás můžou být užitečné: Zjištění délky řetězce : funkce strlen bere jako parametr řetězec a vrací jeho délku. Jedná se o jednu z nejčastěji používaných funkcí při práci s řetězci a vyplatí se jí tak znát. Při jejím použití je ovšem nutné si dát pozor na to, že délka provádění této funkce závisí na tom, jak je řetězec dlouhý. Pokud bude mít řetězec milion znaků, tak bude tato funkce muset projít všech milion znaků, dokud nenarazí na znak NUL. Dávejte si tak pozor, abyste tuto funkci nevolali zbytečně často. Například pokud použijete funkci strlen v podmínce cyklu for: for (int i = 0; i < strlen(retezec); i++) { ...
} Tak se délka řetězce vypočte při každé iteraci cyklu. Pokud by tak řetězec měl milion znaků, musel by program provést bilion [4] (!) operací pouze pro zjištění délky řetězce. Lepší volbou (pokud se tedy délka řetězce nemění) je tak předpočítat si jeho délku dopředu a uložit si ji do proměnné: int delka = strlen(retezec);
for (int i = 0; i < delka; i++) { ...
} 1 000 000 000 000 Porovnání dvou řetězců : běžnou operací, kterou bychom s řetězci chtěli udělat, je porovnat, zdali jsou dva řetězce stejné, popřípadě který z nich je menší [5] . Funkce strcmp bere dva řetězce a vrací nulu, pokud se řetězce rovnají, zápornou hodnotu, pokud je první řetězec menší než ten druhý, a kladnou hodnotu, pokud je druhý řetězec menší než první. Pro porovnávání dvou řetězců nikdy nepoužívejte operátor ==! Nebude to fungovat . Pro porovnávání řetězců se používá lexikografické uspořádání . Nalezne se první dvojice znaků (zleva), ve kterém se řetězce liší, a tyto dva znaky se porovnají pomocí jejich číselné (ASCII) hodnoty. Vyhledání řetězce v řetězci : pokud chcete zjistit, jestli se v nějakém řetězci vyskytuje jiný řetězec, můžete použít funkci strstr . Převod textu na číslo : často můžete potřebovat převést textový zápis čísla na jeho číselnou hodnotu. K tomu můžete použít například funkci strtol ( string to long ). První parametr funkce je řetězec, který chcete převést, do druhého parametru můžete předat ukazatel na ukazatel na znak, do kterého se uloží pozice ve vstupním řetězci těsně za načteným číslem. Posledním parametrem je soustava, ve které se má číslo načíst (obvykle to bude desítková soustava, tedy hodnota 10). Návratovou hodnotou funkce je pak načtené číslo. Můžete použít také funkci atoi , která je trochu jednodušší na použití, ale při jejím použití nelze zjistit, zdali při konverzi nedošlo k chybě (například pokud vstupní řetězec nereprezentoval číslo). Cvičení : Pro procvičení práce s řetězci si můžete zkusit některé z těchto funkcí sami naprogramovat. Další úlohy pro práci s řetězci můžete nalézt zde .

172.body:
Načítat vstup po jednotlivých znacích je poměrně zdlouhavé. Velmi často chceme ze vstupu načíst delší úsek textu najednou, například celý řádek. Toho můžeme dosáhnout například použitím funkce fgets . Ta jako parametry přijímá ukazatel na řetězec, do kterého zapíše načítaný řádek a maximální počet znaků, který lze načíst [2] . Třetí parametr je soubor , ze kterého se má vstup načíst. O souborech se dozvíte více později, pokud chcete načítat data ze standardního vstupu, tak použijte jako třetí parametr globální proměnnou stdin, která je nadefinována v souboru <stdio.h>. Pro jednoduché zjištění délky řetězce, do kterého zapisujete, můžete použít operátor sizeof: Tato velikost je včetně znaku '\0', který je vždy zapsán na konec vstupního řetězce. Pokud tak máte řetězec (pole) o délce 10, předejte do fgets hodnotu 10. Funkce načte maximálně 9 znaků a na konec řetězce umístí znak '\0'. #include <stdio.h> int main() { char buf[80]; // načti řádek textu ze vstupu do řetězce `buf` fgets(buf, sizeof(buf), stdin); return 0;
} Pokud tato funkce vrátí návratovou hodnotu NULL, tak při načítání došlo k chybě. Tuto chybu byste tak ideálně měli nějak ošetřit: #include <stdio.h> int main() { char buf[80]; if (fgets(buf, sizeof(buf), stdin) == NULL) { printf("Nacteni dat nevyslo. Ukoncuji program\n"); return 1; } return 0;
} Pokud byl na vstupu řádek ukončený odřádkováním (\n), tak se toto odřádkování bude nacházet i v načteném řetězci po zavolání fgets! Pokud tedy takto načtený řetězec chcete například porovnat s jiným řetězcem, měli byste nejprve znak odřádkování odstranit. Více se můžete dozvědět zde .

174.body:
Pomocí scanf můžeme načítat také celé řetězce pomocí zástupného znaku %s. Zde si ovšem musíme dávat pozor, abychom u něj uvedli i maximální délku řetězce, do kterého chceme text načíst [3] : char buf[21];
scanf("%20s", buf); Narozdíl od funkce fgets se zde musí uvést délka o jedna menší, než je délka cílového řetězce, do kterého znaky zapisujeme. Pokud bychom použili zástupný znak %s bez uvedené velikosti cílového řetězce, snadno by se mohlo stát, že nám uživatel zadá moc dat, které by funkce scanf začala vesele zapisovat i za paměť předaného řetězce, což může vést buď k pádu programu (v tom lepším případě) nebo ke vzniku bezpečnostní zranitelnosti, pomocí které by uživatel našeho programu mohl například získat přístup k počítači, na kterém program běží (v tom horším případě): char buf[21];
// pokud uživatel zadá více než 20 znaků, může svým vstupem začít přepisovat paměť
// běžícího programu
scanf("%s", buf);

175.body:
Funkce scanf ignoruje bílé znaky (mezery, odřádkování, tabulátory atd.) mezi jednotlivými zástupnými znaky ve formátovacím řetězci. Například v následujícím kódu je validním vstupem x8, x 8 i x 8: int a;
scanf("x%d", &a); I když může toto chování být užitečné, někdy je také celkem neintuitivní. Problém může způsobovat zejména, pokud se pro načítání vstupu kombinuje formátované načítání (scanf) s neformátovaným načítáním (např. fgets). Funkce scanf totiž bílé znaky nechá ve vstupu ležet, pokud je nepotřebuje zpracovat. Následující program načítá číslo pomocí funkce scanf a poté se snaží načíst následující řádek textu pomocí funkce fgets: int cislo;
scanf("%d", &cislo); char radek[80];
fgets(radek, sizeof(radek), stdin); Pokud tomuto programu předáme text 5\nahoj, očekávali bychom, že se v řetězci radek objeví ahoj. Nicméně funkce scanf načte číslo 5 a nechá ve vstupu ležet znak odřádkování, protože nic dalšího načíst nepotřebuje. Funkce fgets poté uvidí znak odřádkování, načte jej a skončí své provádění (načte prázdný řádek), což zřejmě není chování, které bychom od programu čekali.

181.body:
K výpisu formátovaného textu na stdout můžeme použít funkci printf, s kterou jsme se již mnohokrát setkali. Prvním parametrem funkce je formátovací řetězec, do kterého můžete dávat zástupné znaky. Pro každý zástupný znak funkce očekává jednu hodnotu (argument) za formátovacím řetězcem, která bude zformátována na výstup. Například takto můžeme vytisknout číslo a po něm řetězec: const char* text = "Cislo";
int cislo = 5;
printf("Cislo %d, retezec %s: \n", cislo, text); Zástupné znaky funkcí printf i scanf jsou obdobné, jejich seznam a různé možnosti nastavení můžete najít v dokumentaci . Stejně jako scanf má i funkce printf různé varianty pro formátovaný výpis do souborů (fprintf) či do řetězce v paměti (sprintf).

182.body:
Nyní už umíme pracovat se základními datovými typy v C ( celá čísla , desetinná čísla , pravdivostní hodnoty , znaky ) a také umíme pracovat s jejich adresami a vytvářet jich více najednou . Doposud jsme však vždy pracovali s každým datovým typem zvlášť. Představte si, že byste chtěli naprogramovat hru, ve které budete mít nějaké počítačem ovládané příšery [1] . Každá příšera může mít spoustu vlastností – jméno, počet životů, zranění, které uděluje, umístění na mapě, kořist atd. Zároveň bude takových příšer v naší hře určitě více. Mohli bychom tak příšery reprezentovat pomocí pole pro každou jeho vlastnost: const char* prisera_jmeno[100];
int prisera_zivot[100];
int prisera_zraneni[100];
float prisera_poloha_x[100];
float prisera_poloha_y[100];
... Non-player character (NPC) I když by jistě šlo programy tvořit tímto způsobem, asi sami uznáte, že to není ideální, protože to má spoustu nevýhod: Pokud bychom například změnili (maximální) počet příšer, museli bychom synchronizovat tuto velikost mezi všemi poli, které reprezentují jednotlivé vlastnosti příšer. K názvům proměnných musíme přidávat nějakou předponu (např. prisera), abychom dali najevo, že tyto proměnné vlastně patří k jednomu logickému prvku (příšeře). Pokud bychom chtěli jednu takovou příšeru poslat do funkce, tak by to vyžadovalo spoustu parametrů: int vypocti_pocet_zkusenosti( const char* prisera_jmeno, int prisera_zivot, int prisera_zraneni, float prisera_poloha_x, float prisera_poloha_y, ...
) { } Celou příšeru bychom ani nemohli z funkce přímočaře vrátit, protože funkce mohou vracet pouze jednu hodnotu. Pokud bychom chtěli příšeře přidat novou vlastnost, museli bychom přidat novou proměnnou nebo pole na všechna místa, kde s příšerami pracujeme. Například by se musely změnit parametry každé funkce, která by přijímala příšeru. Co bychom ve skutečnosti chtěli překladači říct, je něco ve smyslu Příšera je něco, co má jméno, počet životů, zranění, pozici a kořist, a poté bychom chtěli ve funkci například říct Vytvoř pole 100 příšer: Prisera prisery[100]; Takto bychom zlepšili úroveň abstrakce našeho kódu – v tomto konkrétním případě bychom se mohli začít v kódu bavit o příšeře místo pouze o sadě atributů jméno, počet životů, zranění, …. Jinak řečeno, chtěli bychom si vytvořit náš vlastní datový typ. A právě to můžeme v C udělat pomocí struktur . Struktury jsou posledním syntaktickým prvkem C , o kterém se budeme v předmětu UPR bavit. Jazyk C sice obsahuje i několik dalších syntaktických prvků , které jsme si neukázali, ty však nejsou nutné pro tvorbu jednoduchých programů. Dále se už pouze budeme bavit o konkrétních aplikacích toho, co jsme se naučili, pro tvorbu různých typů programů.

183.body:
Struktury ( structures ) nám umožňují popsat nový datový typ, který se bude skládat z jednoho či více tzv. členů ( members ) [1] . Každému členu musíme určit jeho jméno a datový typ. Novou strukturu můžeme popsat pomocí tzv. deklarace struktury : struct <název struktury> { <datový typ prvního členu> <název prvního členu>; <datový typ druhého členu> <název druhého členu>; <datový typ třetího členu> <název třetího členu>; ...
}; Při deklaraci struktury nezapomínejte na finální středník za složenými závorkami, je povinný. Můžete se setkat také s názvy atribut ( attribute ), vlastnost ( property ) nebo field . V kontextu struktur C označují všechny tyto názvy jedno a to samé - člena struktury. Například, pokud bychom chtěli vytvořit datový typ reprezentující příšeru, která má své jméno a počet životů, můžeme deklarovat následující strukturu: struct Prisera { const char* jmeno; int pocet_zivotu;
}; Tento kód sám o sobě nic neprovádí ! Pouze pomocí něj říkáme překladači, že vytváříme nový datový typ s názvem struct Prisera. Poté nám překladač umožní dále v programu vytvořit například lokální proměnnou tohoto datového typu: // lokální proměnná s názvem `karel` a datovým typem `struct Prisera`
struct Prisera karel; Pro pojmenovávání struktur používejte v rámci předmětu UPR jmennou konvenci PascalCase . Struktury jsou plnohodnotnými datovými typy. Můžete tak vytvářet ukazatele na struktury, pole struktur, můžete použít struktury jako členy jiné struktury atd.

184.body:
Pokud vytvoříme proměnnou datového typu struktury, tak překladač naalokuje paměť pro všechny členy této struktury. V případě výše by proměnná karel obsahovala nejprve byty pro ukazatel const char* a poté byty pro int. Členové struktury budou v paměti uloženi ve stejném pořadí, v jakém byly popsány při deklaraci struktury. Neznamená to ovšem, že musí ležet hned za sebou! Překladač se může rozhodnout mezi členy struktury v paměti vložit mezery (tzv. padding ) kvůli urychlení provádění programu [2] . Pro některé typy procesorů může být rychlejší přistupovat k adresám v paměti, které jsou například násobkem 4 nebo 8. Proto překladač mezery do struktur vkládá, aby jednotlivé členy zarovnal ( align ) v paměti. Více se můžete dozvědět například zde . Z toho vyplývá, že velikost struktury není vždy zcela intuitivní. Například následující struktura s názvem StiskKlavesy obsahuje jeden znak (char) s velikostí 1 byte a jedno číslo (int) s velikostí 4 byty. Kvůli "neviditelným" mezerám vloženým překladačem ovšem velikost struktury nemusí být 5 bytů! #include <stdio.h> struct StiskKlavesy { char klavesa; int delka;
}; int main() { printf("Velikost znaku: %lu
", sizeof(char)); printf("Velikost cisla: %lu
", sizeof(int)); printf("Velikost struktury StiskKlavesy: %lu
", sizeof(struct StiskKlavesy)); return 0;
} Proto pro zjištění velikosti struktury (například při dynamické alokaci paměti) vždy používejte operátor sizeof .

187.body:
Abychom mohli číst a zapisovat jednotlivé členy struktur, můžeme použít operátor přístupu ke členu ( member access operator ), který má syntaxi <výraz typu struktura>.<název členu>: #include <stdio.h> struct Osoba { int vek; int pocet_pratel;
}; int main() { struct Osoba martina = { .vek = 18, .pocet_pratel = 10 }; martina.vek += 1; martina.pocet_pratel += 20; printf("Martina ma %d let a ma %d pratel\n", martina.vek, martina.pocet_pratel); return 0;
} Pokud máme k dispozici pouze ukazatel na strukturu, tak je přístup k jejím členům trochu nepraktický kvůli prioritě operátorů . Operátor dereference (*) má totiž menší prioritu než operátor přístupu ke členu (.). Abychom tak nejprve z ukazatele na strukturu načetli její hodnotu a až poté přistoupili k jejímu členu, museli bychom použít závorky: void pridej_pratele(struct Osoba* osoba) { (*osoba).pocet_pratel++;
} Jelikož ukazatele na struktury jsou využívány velmi často, C nabízí pro tuto situaci zkratku v podobě operátoru přístupu k členu přes ukazatel ( member access through pointer ), který má syntaxi <ukazatel na strukturu>-><název členu>: void pridej_pratele(struct Osoba* osoba) { osoba->pocet_pratel++;
} Operátor -> je čistě syntaktickou zkratkou, tj. platí *(ukazatel).clen == ukazatel->clen.

188.body:
Možná vás napadlo, že psát při každém použití struktury klíčové slovo struct před jejím názvem je zdlouhavé. C umožňuje dávat datovým typům nové názvy, aby se nám s nimi lépe pracovalo. Lze toho dosáhnout pomocí syntaxe typedef <datový typ> <jméno>;: typedef int teplota; int main() { teplota venkovni = 24; return 0;
} Pomocí typedef vytvoříme nové jméno pro datový typ, pomocí kterého se pak na tento typ můžeme odkazovat (původní název datového typu to však nijak neovlivní a můžeme ho stále používat). Opět platí, že takto vytvořené jméno lze použít pouze v oblasti ( scopu ), kde byl typedef použit. Obvykle se používá na nejvyšší úrovni souboru. U struktur si pomocí typedef můžeme zkrátit jejich název ze struct <nazev> na <nazev>: struct Osoba { int vek;
}; typedef struct Osoba Osoba; int main() { Osoba jiri; return 0;
} Toto lze ještě více zkrátit, pokud deklaraci struktury použijeme přímo na místě datového typu v typedef: typedef struct Osoba { int vek;
} Osoba; A konečně, abychom nemuseli jméno struktury opakovat dvakrát, můžeme vytvořit tzv. anonymní strukturu ( anonymous structure ) bez názvu, a jméno jí přiřadit až pomocí typedef. typedef struct { int vek;
} Osoba; Právě takto se obvykle deklarují struktury v C .

189.body:
Jelikož deklarace struktury vytvoří nový datový typ, nic vám nebrání v tom používat struktury jako členy jiných struktur [3] : typedef struct { float x; float y;
} Poloha; typedef struct { const char* jmeno; int cena;
} Vec; typedef struct { int pocet_zivotu; Poloha poloha; Vec korist[10];
} Prisera; int main() { Prisera prisera = { .pocet_zivotu = 100, .poloha = { .x = 0, .y = 0 } }; return 0;
} Díky tomu můžeme vytvářet celé hierarchie datových typů, což může značně zpřehlednit náš program, protože můžeme pracovat s kódem na vyšší úrovni abstrakce. Lze si můžete všimnout, že vnořené struktury lze inicializovat stejně jako proměnné struktur, tj. pomocí složených závorek {}.

191.body:
Pomocí struktur si můžeme vytvořit nový datový typ, což pomáhá přehlednosti programů, protože se díky tomu můžeme v programech vyjadřovat pomocí pojmů z oblasti (tzv. domény), kterou se náš program zabývá (Student, Příšera, Munice, Letadlo, Volant atd.) a ne pouze pomocí pojmů, kterým rozumí počítač (číslo, znak, pravdivostní hodnota). Abychom pracovali s ještě vyšší úrovní abstrakce, bylo by užitečné, pokud bychom mohli k vlastním datovým typům nadefinovat také vlastní operace, které by s nimi uměly pracovat. Některé programovací jazyky umožňují provádět tzv. přetěžování operátorů ( operator overloading ), pomocí kterého můžeme například umožnit používání operátorů jako je + s vlastními datovými typy. C toto sice neumožňuje, nicméně chování můžeme k námi vytvořeným strukturám přidat pomocí funkcí. Často tak k naší struktuře chceme vytvořit sadu funkcí, které s ní budou pracovat. V C pro tento koncept neexistuje žádná syntaktická podpora. Obvykle se tak prostě takovéto funkce pojmenují tak, aby začínaly názvem struktury, ke které jsou přidružené, a přebírají ukazatel na tuto strukturu jako svůj první parametr [1] : #include <stdbool.h>
#include <stdio.h> typedef struct { float x; float y;
} Poloha; typedef struct { const char* jmeno; int skore; Poloha poloha;
} Hrac; void hrac_posun(Hrac* hrac, int x, int y) { hrac->poloha.x += x; hrac->poloha.y += y;
}
void hrac_pridej_skore(Hrac* hrac, int skore) { hrac->skore += skore; if (hrac->skore > 100) { hrac->skore = 100; }
}
bool hrac_vyhral(Hrac* hrac) { return hrac->skore == 100;
} int main() { Hrac hrac = { .jmeno = "Jindrich", .skore = 40, .poloha = { .x = 10, .y = 20 } }; hrac_posun(&hrac, 5, -8); hrac_pridej_skore(&hrac, 70); printf("Hrac vyhral: %d\n", hrac_vyhral(&hrac)); return 0;
} Ukazatel se používá, abychom nemuseli struktury při předávání do funkcí kopírovat (mohou být relativně velké) a abychom je mohli případně zevnitř funkcí modifikovat. Pokud vytvoříme vhodné datové typy (struktury) a budeme s nimi pracovat pomocí funkcí, tak by se naše programy měly přibližovat k tomu, aby je šlo číst jako plynulý a přehledný text. Vytváření vlastních datových typů, které mají přidružené chování, je základem tzv. Objektově orientovaného programování .

198.body:
Jakmile řeknete funkci fopen jaký soubor (a v jakém módu) má otevřít, funkce jej otevře a vrátí vám ukazatel na strukturu FILE, pomocí které můžete se souborem dále pracovat [3] . Stejně jako u jakékoliv práce se vstupem a výstupem i při práci se soubory však může často docházet k různým chybám. FILE je tzv. neprůhledná ( opaque ) struktura deklarovaná ve standardní knihovně C . Nebudete přistupovat k žádným jejím členům, pouze budete ukazatel na ni posílat do různých funkcí pro práci se soubory, abyste určili, s jakým (otevřeným) souborem chcete pracovat. Pokud byste se například pokoušeli otevřít neexistující soubor v módu pro čtení "r", dojde k chybě. V takovém případě vám funkce fopen vrátí adresu nula (tzv. NULL ukazatel). Po každém pokusu o otevření souboru byste tak měli ověřit, zdali se otevření opravdu podařilo nebo ne. Pokud při otevření došlo k chybě, tak se do globální proměnné errno uloží číslo, které identifikuje, o jaký typ chyby šlo [4] . K proměnné budete mít přístup, pokud do svého programu vložíte soubor <errno.h>. Pomocí funkce strerror ze souboru <string.h> pak můžete získat řetězec, který danou chybu popisuje: #include <stdio.h>
#include <errno.h>
#include <string.h> int main() { FILE* soubor = fopen("soubor.txt", "r"); if (soubor == NULL) { printf("Doslo k chybe pri otevirani souboru: %s\n", strerror(errno)); return 1; // došlo k chybě, vrátíme 1 jako chybový stav programu } return 0;
} Seznam různých chybových hodnot, které se můžou v errno objevit, můžete naleznout například zde .

2.body:
Z pohledu počítače je program sekvence příkazů (nazývaných instrukce ), které může počítač vykonat k vyřešení nějakého problému. Abychom mohli počítači říct, co má vykonávat, potřebujeme mu příkazy zadat ve formě, které bude rozumět. Ač se to možná nezdá, tak počítače umí vykonávat pouze velmi jednoduché příkazy. V podstatě umí pouze provádět aritmetické a logické operace (sčítání, odčítání, násobení) s čísly a manipulovat (číst, zapisovat, přesouvat) s těmito čísly v paměti. Veškeré složitější úkoly, jako třeba vykreslení obrázku na obrazovku, zapsání textu do dokumentu nebo simulace světa v počítačové hře je výsledkem kombinací tisíců či milionů takovýchto jednoduchých instrukcí. Zde je ukázka jednoduchého programu, který zdvojnásobí číslo 8 pomocí příkazů MOV a ADD: MOV EAX, 8
ADD EAX, EAX Pokud bychom programy psali pouze pomocí těchto jednoduchých příkazů [1] , tak by bylo složité se v nich vyznat, obzvláště, pokud by obsahovaly stovky, tisíce nebo dokonce miliony takovýchto příkazů. Ideálně bychom chtěli programy zapisovat v přirozeném jazyce (Vykresli čtverec na obrazovku, Zapiš text do dokumentu), nicméně tomu počítače nerozumí a je velmi náročné jej převést na správnou sekvenci příkazů pro počítač, protože jazyky, které používáme, jsou často nejednoznačné a nemají jednotnou strukturu. Vyzkoušíte si to v navazujícím předmětu Architektury počítačů a paralelních systémů . Jako kompromis tak vznikly programovací jazyky , které umožňují zápis programů ve formě, která je lidem srozumitelná, ale zároveň ji lze relativně jednoduše převést na příkazy, které je schopen počítač provést. Převodu programu zapsaného v programovacím jazyce na počítačové instrukce se říká překlad ( compilation ) a programy, které tento překlad provádějí, se nazývají překladače ( compilers ) . Později si ukážeme, jak takovýto překladač použít k překladu kódu. Zde je ukázka části programu v jazyce C : while (je_tlacitko_zmacknuto(MEZERNIK)) { posun_nahoru(postava);
} I někdo, kdo se s jazykem C nikdy nesetkal, může z tohoto kusu kódu zhruba odvodit, co asi dělá, pokud ho přečte jako větu. Tento program však může být převeden na stovky až tisíce počítačových instrukcí a z takového množství příkazů už by bylo složité odvodit, k čemu je program určen.

200.body:
Jakmile se souborem přestanete pracovat, je nutné ho zavřít. K tomu slouží funkce fclose : FILE* soubor = fopen("soubor.txt", "w");
// zápis/čtení ze souboru…
fclose(soubor); Funkce fclose vrací číselnou hodnotu, která oznamuje, zdali funkce proběhla v pořádku nebo ne. Pokud funkce vrátí 0, tak se soubor úspěšně uzavřel. I u zavírání souborů bychom tedy měli mít alespoň základní ošetření chyb [5] : assert(!fclose(soubor)); Operátor ! provede logickou negaci. Pokud jej použijeme s hodnotou 0, vrátí hodnotu 1. Pokud jej použijeme s jakoukoliv jinou hodnotou, vrátí hodnotu 0. Pokud tedy funkce fclose vrátí cokoliv jiného než 0, assert ukončí program. Pokud bychom soubor nezavřeli, tak se například může stát, že kvůli použitému bufferování by se data, která jsme do souboru zapsali, nemusela objevit na souborovém systému.

204.body:
Pokud chceme do otevřeného souboru zapsat nějaké byty, můžeme použít funkci fwrite : size_t fwrite( const void* buffer, // adresa, ze které načteme data do souboru size_t size, // velikost prvku, který zapisujeme size_t count, // počet prvků, které zapisujeme FILE* stream // soubor, do kterého zapisujeme
); Funkce fwrite předpokládá, že budeme do souboru zapisovat více hodnot stejného datového typu. Parametr size udává velikost tohoto datového typu a parametr count počet hodnot, které chceme zapsat. Pokud tuto funkci zavoláme, tak dojde k zápisu size * count bytů z adresy buffer do souboru stream. Návratová hodnota fwrite značí, kolik prvků bylo do souboru úspěšně zapsáno. Pokud je tato hodnota menší než count, tak došlo k nějaké chybě. Například zápis pěti celých čísel do souboru by mohl vypadat následovně: #include <stdio.h>
#include <assert.h> int main() { int pole[5] = { 1, 2, 3, 4, 5 }; // otevření souboru FILE* soubor = fopen("soubor", "wb"); assert(soubor); // binární zápis do souboru int zapsano = fwrite(pole, sizeof(int), 5, soubor); assert(zapsano == 5); // zavření souboru fclose(soubor); return 0;
} Při takovémto použití fwrite může dojít k zapsání například pouze 3 čísel, pokud během zápisu dojde k chybě [1] . Pokud bychom chtěli zapsat buď vše nebo nic, můžeme říct, že zapisujeme pouze jeden prvek a parameter count nastavit na celkovou velikost všech dat, které chceme zapsat: int pole[5] = { 1, 2, 3, 4, 5 };
fwrite(pole, sizeof(pole), 1, soubor); V takovémto případě by funkce fwrite vrátila hodnotu 3. Pokud bychom zapsali pole do souboru takto, uloží se do něj celkem 20 (5 * 4) bytů (čísel), které později můžeme v programu zase načíst zpátky . Pokud bychom se podívali, co v souboru je, nalezli bychom seznam čísel 1 0 0 0 2 0 0 0 3 0 0 0 4 0 0 0 5 0 0 0, což odpovídá paměťové reprezentaci pole pěti intů, které bylo vytvořeno výše.

205.body:
Pokud bychom chtěli tato data zapsat do souboru v textové podobě (a ne pouze jako jejich binární reprezentaci), můžeme čísla z výše zmíněného pole zapsat pomocí nějakého textového kódování, například ASCII . K tomu můžeme využít funkci fprintf , která funguje stejně jako printf, s tím rozdílem, že text nevypisuje na stdout, ale do předaného souboru [2] : #include <stdio.h>
#include <assert.h> int main() { int pole[5] = { 1, 2, 3, 4, 5 }; // otevření souboru FILE* soubor = fopen("soubor.txt", "wt"); assert(soubor); // textový zápis do souboru for (int i = 0; i < 5; i++) { fprintf(soubor, "%d ", pole[i]); } // zavření souboru fclose(soubor); return 0;
} Všimněte si, že zde jsme použili mód otevření pro textový zápis ("w"), namísto binárního zápisu "wb" použitého výše. V tomto případě by se do souboru zapsalo deset bytů (čísel) 49 32 50 32 51 32 52 32 53 32, protože číslice jsou v ASCII reprezentovány čísly 48 až 57 a mezera je reprezentována číslem 32. Pokud bychom tento soubor otevřeli v textovém editoru, tak by se nám zobrazil text 1 2 3 4 5 .

207.body:
Pro čtení ze souboru můžeme použít funkci fread , která je protikladem funkce fwrite: size_t fread( void* buffer, // adresa, na kterou zapíšeme data ze souboru size_t size, // velikost prvku, který načítáme size_t count, // počet prvků, které načítáme FILE* stream // soubor, ze kterého čteme
); Tato funkce opět předpokládá, že budeme ze souboru načítat několik hodnot stejného datového typu. Například načtení pěti celých čísel, které jsme zapsali v kódu zde , by mohlo vypadat následovně: #include <stdio.h>
#include <assert.h> int main() { int pole[5] = { 1, 2, 3, 4, 5 }; // otevření souboru FILE* soubor = fopen("soubor", "rb"); assert(soubor); // čtení ze souboru int precteno = fread(pole, sizeof(int), 5, soubor); assert(precteno == 5); // zavření souboru fclose(soubor); return 0;
} Funkce fread vrací počet prvků, které úspěšně načetla ze souboru.

209.body:
Při čtení ze souboru je třeba vyřešit jednu dodatečnou věc – jak rozpoznáme, že už jsme soubor přečetli celý a už v něm nic dalšího nezbývá? Pokud načítáme data ze souboru "binárně", tj. interpretujeme je jako byty a ne jako (ASCII) text, obvykle stačí si velikost souboru předpočítat po jeho otevření pomocí funkcí ftell a fseek nebo si ji přečíst přímo ze samotného souboru [2] . Spousta binárních formátů (např. JPEG) jsou tzv. samo-popisné ( self-describing ), což znamená, že typicky na začátku souboru je v pevně stanoveném formátu (tzv. hlavičce ) uvedeno, jak je daný soubor velký. Využijeme toho například při práci s obrázkovým formátem TGA . Co ale dělat, když načítáme textové soubory, jejichž formát obvykle není ani zdaleka pevně daný? Předpočítat si velikost souboru a pak muset po každém načtení např. řádku počítat, kolik znaků jsme vlastně načetli, by bylo relativně komplikované. Při čtení textových souborů se tak obvykle využívá jiná strategie – čteme ze souboru tak dlouho, dokud nedojde k chybě. Způsob detekce chyby záleží na použité funkci: fscanf vrátí číslo <= 0, pokud se jí nepodaří načíst žádný zástupný znak ze vstupu. fgets vrátí ukazatel s hodnotou 0, pokud dojde k chybě při čtení. Jakmile dojde k chybě, tak bychom ještě měli ověřit, jestli jsme opravdu na konci souboru, anebo byla chyba způsobena něčím jiným [3] . To můžeme zjistit pomocí funkcí feof , která vrátí nenulovou hodnotu, pokud jsme se před jejím zavoláním pokusili o čtení a pozice již byla na konci souboru, a ferror , která vrátí nenulovou hodnotu, pokud došlo k nějaké jiné chybě při práci se souborem. Například pokud čteme soubor z USB flashky, který je během čtení odpojen od počítače. Program, který by načítal a rovnou vypisoval řádky textu ze vstupního souboru, dokud nedojde na jeho konec, by tedy mohl vypadat například takto: #include <assert.h>
#include <errno.h>
#include <stdio.h>
#include <string.h> int main() { FILE* soubor = fopen("soubor.txt", "rt"); assert(soubor); char radek[80]; while (1) { if (fgets(radek, sizeof(radek), soubor)) { // radek byl uspesne nacten printf("Nacteny radek: %s", radek); } else { if (feof(soubor)) { printf("Dosli jsme na konec souboru\n"); } else if (ferror(soubor)) { printf("Pri cteni ze souboru doslo k chybe: %s\n", strerror(errno)); } break; } } fclose(soubor); return 0;
}

