V C platí tzv. pravidlo jedné definice ( one definition rule ). Každá proměnná i funkce musí být v programu nadefinována právě jednou (deklarována může být vícekrát). To platí jak v rámci jednoho souboru, tak v rámci celého programu (tj. napříč všemi zdrojovými soubory). Pokud bychom proměnnou či funkci pouze nadeklarovali a/nebo použili bez definice: // soubor.c
void funkce(); int main() { funkce(); return 0;
} Tak by kompilace selhala v době linkování, protože by nenašel žádnou funkci/proměnnou, kterou by mohl použít: $ gcc -c soubor.c
$ gcc soubor.o
/usr/bin/ld: test.o: in function `main':
test.c:(.text+0xe): undefined reference to `funkce'
collect2: error: ld returned 1 exit status Pokud bychom naopak nadefinovali proměnnou či funkci více než jednou: // soubor1.c
void funkce() {} int main() { funkce(); return 0;
}
// soubor2.c
void funkce() {} Tak by linkování opět selhalo, protože by linker nevěděl, kterou definici použít: $ gcc -c soubor1.c
$ gcc -c soubor2.c
$ gcc soubor1.o soubor2.o
/usr/bin/ld: soubor2.o: in function `funkce':
soubor2.c:(.text+0x0): multiple definition of `funkce'; test.o:test.c:(.text+0x0): first defined here
collect2: error: ld returned 1 exit status

