Jednotlivé části z hlavičky bychom mohli načítat byte po bytu, nicméně to by bylo dosti nepraktické. V případě, že formát, který chceme načíst, má pevně dané rozložení bytů, je mnohem jednodušší nadefinovat si strukturu , která bude danému rozložení odpovídat, a poté celou strukturu načíst ze souboru najednou. Jednotlivé hodnoty v hlavičce jsou reprezentovány byty bez znaménka. Jelikož tento datový typ v C má trochu zdlouhavý název, vytvořme si pro něj nejprve nové jméno byte: typedef unsigned char byte; Nyní si vytvořme strukturu, která bude reprezentovat TGA hlavičku. Jednotlivé atributy struktury musí přesně odpovídat hodnotám v hlavičce a musí být také uvedeny ve stejném pořadí: typedef struct { byte id_length; byte color_map_type; byte image_type; byte color_map[5]; byte x_origin[2]; byte y_origin[2]; byte width[2]; byte height[2]; byte depth; byte descriptor;
} TGAHeader; Možná vám přijde zvláštní, proč např. šířku definujeme jako pole dvou bytů namísto použití "dvou-bajtového celého čísla", tedy datového typu short. Děláme to, aby do této struktury překladač nevložil žádné mezery . Pokud by je tam vložil, tak by naše struktura v paměti už neodpovídala hlavičce TGA v souboru a četli bychom tak neplatné hodnoty. Když použijeme pro všechny atributy datový typ s velikostí 1 byte, tak překladač žádné mezery vkládat nebude. Alternativním řešením by bylo říct překladači, ať do dané struktury žádné mezery nevkládá . Nyní už stačí pouze otevřít nějaký TGA soubor (např. tento ), načíst z něj počet bytů odpovídající naší struktuře a poté si z ní můžeme přečíst informace o daném obrázku: FILE* file = fopen("carmack.tga", "rb");
assert(file); TGAHeader header = {};
assert(fread(&header, sizeof(TGAHeader), 1, file) == 1); printf("Image type: %d, pixel depth: %d\n", header.image_type, header.depth); Pokud budeme chtít pracovat s hodnotami rozměrů či počátku, musíme je nejprve převést z pole bytů na celé číslo. Toho můžeme dosáhnout pomocí funkce memcpy : int width = 0;
int height = 0; memcpy(&width, header->width, 2);
