Jakmile jsme načetli hlavičku, můžeme načíst ze souboru i samotné pixely. Ty jsou umístěny v souboru hned za hlavičkou. Každý pixel má odpovídající počet bytů podle typu obrázku (u RGB obrázků 3 byty [1] , u obrázků ve stupních šedi 1 byte) a počet pixelů je dán rozměry obrázku (šířka * výška). V TGA jsou jednotlivé barevné složky uložené v pořadí blue, green, red. Jedná se tedy vlastně o formát BGR. Můžeme si tak vytvořit pole pro pixely a načíst je z obrázku. Pro RGB obrázky by načtení pixelů mohlo vypadat např. takto: typedef struct { byte blue; byte green; byte red;
} Pixel; Pixel* load_pixels(TGAHeader header, FILE* file) { int width = 0; int height = 0; memcpy(&width, header.width, 2); memcpy(&height, header.height, 2); Pixel* pixels = (Pixel*) malloc(sizeof(Pixel) * width * height); assert(fread(pixels, sizeof(Pixel) * width * height, 1, file) == 1); return pixels;
}

