Pro práci s GIF souborem si nejprve musíme nadefinovat tzv. paletu ( palette ). Paleta není nic jiného než pole barev, které můžeme v naší animaci používat. Jednotlivým pixelům každého snímku pak pouze řekneme, jaký index z této palety se má použít pro jejich vykreslení. Například tato paleta definuje čtyři barvy: typedef unsigned char byte; byte palette[] = { 0x00, 0x00, 0x00, /* 0 -> černá (R=0, G=0, B=0) */ 0xFF, 0x00, 0x00, /* 1 -> červená (R=255, G=0, B=0) */ 0x00, 0xFF, 0x00, /* 2 -> zelená (R=0, G=255, B=0) */ 0x00, 0x00, 0xFF, /* 3 -> modrá (R=0, G=0, B=255) */
}; Pokud použijeme pro pixel index 1, bude vykreslen červenou barvou, protože v této paletě se na pozici 1 nachází červená barva. Jakmile máme nadefinovanou paletu, můžeme použít funkci ge_new_gif, která umožňuje vytvořit nový GIF soubor. Funkci musíme předat cestu k výstupnímu souboru, jeho rozměry, informace o paletě a o tom, kolikrát se má animace přehrát [2] : int width = 300;
int height = 300; ge_GIF* gif = ge_new_gif( "output.gif", width, height, palette, 2, /* hloubka palety */ 0 /* opakovat neustále dokola */
); Parametr hloubky palety by měl být nastaven na dvojkový logaritmus počtu baret v paletě. V naší paletě jsou 4 barvy, takže jsme zde předali hodnotu parametru 2. Poslední parametr udává, kolikrát se má animace přehrát. Hodnota 0 udává, že se má animace opakovat neustále dokola [3] . Pro použití hlavičkového souboru knihovny nezapomeňte na začátku svého programu vložit hlavičkový soubor gifenc.h. Všechny tyto údaje lze vyčíst z dokumentace knihovny.

