Počítače jsou deterministické stroje, což znamená, že stejný program vždy na stejný vstup vrátí stejný výstup. Často ovšem chceme, aby naše programy obsahovaly prvky "náhody", když chceme například: Hodit si kostkou v deskové hře Udělit náhodný počet zranění v rozsahu zbraně Oživit hráče na náhodné pozici na mapě Počítače samy o sobě opravdovou náhodu vytvořit nemohou, nicméně můžou ji simulovat pomocí tzv. pseudo-náhodných generátorů čísel ( pseudo-random number generation ). Vygenerovat (pseudo-)náhodnou sekvenci čísel pomocí deterministických operací můžeme například následujícím algoritmem: Začneme s číslem S, které se nazývá počáteční náhodná hodnota ( random seed ). Aplikujeme nějakou matematickou operaci na S a vyjde nám nové číslo N. N použijeme jako vygenerované "náhodné číslo". Nastavíme S = N. Opakujeme postup od bodu 2). Ukázka kódu, který takovýto algoritmus implementuje: int S = 5;
int vygeneruj_cislo() { int N = S; N = (5 * N + 3) % 6323; N = (4 * N + 2) % 8127; S = N; return N;
}
int main() { int r1 = vygeneruj_cislo(); // 114 int r2 = vygeneruj_cislo(); // 2294 int r3 = vygeneruj_cislo(); // 4348 int r4 = vygeneruj_cislo(); // 2971 int r5 = vygeneruj_cislo(); // 723 return 0;
} Takovýto algoritmus bude generovat (nekonečnou) sekvenci čísel, která bude lidem připadat "náhodná" (bude těžké uhodnout, jaké číslo algoritmus vrátí příště).

