Operátor & provádí bitový součin , očekává jako operandy celá čísla (např. int) a vrací celé číslo. Operátor && provádí logický součin , očekává jako operandy pravdivostní hodnoty (bool) a vrací pravdivostní hodnotu. Je důležité tyto operátory nezaměňovat. Jelikož bool lze implicitně převést na celé číslo a naopak, záměna těchto operátorů opět typicky nepovede k chybě při překladu, nicméně program nejspíše při jejich záměně nebude fungovat tak, jak má. Operátor & má zároveň větší přednost než &&, takže se výraz s tímto operátorem může vyhodnotit jinak, než očekáváte. Obdobná situace platí i u dvojice operátorů | (bitový součet) a || (logický součet). int a = 3;
a & 4; // `0` a && 4; // `true` // stejné jako a > (5 & a) < 6
if (a > 5 & a < 6) {}

