Tato chyba je způsobena pokusem o zapsání nebo čtení neplatné adresy v paměti. K této chybě často dochází zejména při těchto situacích: Zapísujeme nebo čteme z paměti pole mimo jeho rozsah (tj. "před" nebo "za" pamětí pole). Tato situace se nazývá buffer overflow . Tato chyba už způsobila nespočet bezpečnostních chyb v různých softwarech. #include <stdlib.h> int main() { int* p = (int*) malloc(sizeof(int)); p[1] = 5; return 0;
} Pokoušíme se přečíst hodnotu na adrese 0 (NULL), která je používána pro inicializaci ukazatelů. Tato situace se nazývá null pointer dereference . int main() { int* p = (void*) 0; int a = *p; return 0;
} Snažíme se přistoupit k paměti, která již byla uvolněna . Tato situace se nazývá use-after-free . #include <stdlib.h> int main() { int* p = (int*) malloc(sizeof(int)); free(p); *p = 1; return 0;
} Přístup k již uvolněné paměti může nastat i bez použití dynamické paměti . Například tento kód není správně: #include <stdlib.h> int* vrat_ukazatel(int x) { int y = x + 1; return &y;
} int main() { int* p = vrat_ukazatel(1); *p = 1; return 0;
} Jakmile totiž vykonávání funkce vrat_ukazatel skončí, tak se uvolní paměť jejich lokálních proměnných. Adresa uložená v p tak obsahuje nevalidní paměť a je chybou k ní přistupovat (ať už číst, tak zapisovat). Snažíme se uvolnit pamět, která již byla uvolněna. Tato situace se nazývá double free . #include <stdlib.h> int main() { int* p = (int*) malloc(sizeof(int)); free(p); free(p); return 0;
} Zkuste si programy výše spustit nejprve bez Address sanitizeru a poté s ním. Dokázal sanitizer detekovat některé z popsaných paměťových chyb?

