V (Booleovské) logice existují tři základní operátory: logický součin ( AND ): platí X a zároveň Y logický součet ( OR ): platí X nebo Y logická negace ( NOT ): neplatí X Tyto logické operace lze v C použít pomocí následujících operátorů: AND : && OR : || NOT : ! Tyto operátory můžete použít mezi dvěma výrazy datového typu bool. Například: bool je_muz = true;
