🤓 Tato sekce obsahuje doplňující učivo. Pokud je toho na vás moc, můžete ji prozatím přeskočit a vrátit se k ní později. V případě, že byste chtěli provést rozlišný kód v závislosti na hodnotě nějakého výrazu, a tento výraz (např. hodnota proměnné) může nabývat většího množství různých hodnot, tak může být zdlouhavé použít spoustu ifů: if (a == 0) { ...
}
else if (a == 1) { ...
}
else if (a == 2) { ...
}
... Jako jistá zkratka může sloužit příkaz switch. Ten má následující syntaxi: switch (<výraz>) { case <hodnota A>: <blok kódu> case <hodnota B>: <blok kódu> case <hodnota C>: <blok kódu> ...
} Tento příkaz vyhodnotí předaný výraz, a pokud se ve switchi nachází klíčové slovo case následované hodnotou odpovídající hodnotě výrazu, tak program skočí na blok, který následuje za case. Dále se program bude vykonávat sekvenčně až do konce switche (při tomto vykonávání už se case ignoruje) [1] . Toto chování se anglicky označuje jako fallthrough . Tento program vypíše 52, protože předaný výraz má hodnotu 5, takže program skočí na blok za case 5 a dále pokračuje sekvenčně až do konce bloku switch příkazu. #include <stdio.h> int main() { switch (5) { case 0: printf("0"); case 1: printf("1"); case 5: printf("5"); case 2: printf("2"); } return 0;
}

