int b = 5; int c = 0;
if (a < b) { c = a;
} else { c = b;
} Toto lze provést zkráceně pomocí výrazu ternárního operátoru ( ternary operator ). Tento výraz má následující syntaxi: <výraz X typu bool> ? <výraz A> : <výraz B> Pokud je výraz X pravdivý, tak se ternární operátor vyhodnotí jako hodnota výrazu A, v opačném případě se vyhodnotí jako hodnota výrazu B. Uhodnete, co vypíše následující program? #include <stdio.h> int main() { int a = 1; int b = 5; int c = (a >= b) ? a - b : a + b; printf("%d\n", c); return 0;
}

