Ve svých programech budete často chtít provádět nějakou operaci opakovaně, například: Pro každý záznam v databázi vypiš řádek do souboru. Pošli zprávu každému účastníkovi chatu. Načítej řádky ze souboru, dokud nedojdeš na konec souboru. Pokud bychom používali pouze sekvenční zápis příkazů, tak bychom museli neustále kopírovat ("copy-pastovat") kód: printf("0\n");
printf("1\n");
printf("2\n");
... což by vedlo k nepřehledným programům [1] . Pokud bychom navíc našli v programu chybu, museli bychom ji opravit na všech místech, kam jsme kód zkopírovali. Představte si, že chcete na výstup programu nebo do souboru vypsat třeba tisíc různých řádků textu. Ani s kopírováním kódu bychom si však nevystačili, pokud bychom potřebovali provádět kód opakovaně v závislosti na vstupu programu. Představte si situaci, kdy nám uživatel na vstup programu zadá číslo, kolikrát má náš program vypsat nějaký řádek textu na výstup. Uživatel se při každém spuštění programu může rozhodnout pro jiné číslo, 0, 1, 42, 1000. Program však zůstává stále stejný - při jeho psaní se musíme rozhodnout, kolik příkazů pro výpis v něm použijeme, a už poté nemůžeme jednoduše tuto volbu změnit, když program běží. Takovýto program bychom tedy zatím (pouze pomocí proměnných a podmínek) neměli jak naprogramovat. Proto programovací jazyky nabízí tzv. cykly ( loops ), pomocí kterých můžeme jednoduše říct počítači, aby určitý blok kódu opakoval, kolikrát budeme chtít. Díky tomu může program i s pouze několika málo řádky kódu říct počítači, aby provedl spoustu instrukcí. Jazyk C nabízí dva základní typy cyklů, while a for . Další motivací pro využití cyklů je to, že moderní procesory počítačů mají běžně frekvence od 1 do 4 GHz, takže za vteřinu zvládnou provést několik miliard taktů a během každého taktu navíc až desítky různých operací. Jistě si dovedete představit, že s pouze sekvenčním zápisem kódu bychom tento potenciál nemohli naplno využít. I když jeden řádek C kódu může být přeložen až na desítky procesorových instrukcí, tak i kdybychom zvládli napsat program se stovkami milionů řádek, pořád bychom takovýmto programem "zabavili" procesor na pouhou vteřinu. Běžící programy tak obvykle tráví většinu času právě prováděním nějakého cyklu.

87.body:
Nejjednodušším cyklem v C je cyklus while ("dokud"): while (<výraz typu bool>) { // blok cyklu
} Funguje následovně: Nejprve se vyhodnotí (Booleovský) výraz v závorce za while. Pokud: Je výraz pravdivý, tak se provede blok [1] cyklu a dále se pokračuje opět bodem 1. Není výraz pravdivý, tak se provede bod 3. Program pokračuje za cyklem while. Blok cyklu se také často nazývá jako tělo ( body ) cyklu. Jinak řečeno, dokud bude splněná podmínka za while, tak se bude opakovaně provádět tělo cyklu. Vyzkoušejte si to na následujícím příkladu: #include <stdio.h> int main() { int pocet = 0; while (pocet < 5) { printf("Telo cyklu se provedlo, hodnota promenne pocet=%d\n", pocet); pocet = pocet + 1; } return 0;
} Tento kód opět můžeme přečíst jako větu: Dokud je hodnota proměnné pocet menší než pět, prováděj tělo cyklu. Jedno vykonání těla cyklu se nazývá iterace . Cyklus v ukázce výše tedy provede pět iterací, protože se tělo cyklu provede pětkrát. Pokud výraz za while není vyhodnocen jako pravdivý v momentě, kdy se while začne vykonávat, tak se tělo cyklu nemusí provést ani jednou (tj. bude mít nula iterací). Je důležité dávat si pozor na to, aby cyklus, který použijeme, nebyl nechtěně nekonečný ( infinite loop ), jinak by náš program nikdy neskončil. Zkuste v kódu výše zakomentovat nebo odstranit řádek count = count + 1; a zkuste program spustit. Jelikož se hodnota proměnné count nebude nijak měnit, tak výraz count < 5 bude stále pravdivý a cyklus se tak bude provádět neustále dokola. Této situaci se lidově říká "zacyklení" [2] . Pokud se vám někdy stalo, že se program, který jste zrovna používali, "zaseknul" a přestal reagovat na váš vstup, mohlo to být právě například tím, že v něm nechtěně došlo k provedení nekonečného cyklu (došlo k tzv. "zacyklení"). Pokud program spouštíte v terminálu a zacyklí se, můžete ho přerušit pomocí klávesové zkratky Ctrl + C. Pokud jej spustíte v prohlížeči, tak poté radši restartujte tuto stránku pomocí F5 :)

89.body:
V cyklech můžete využít dva speciální příkazy, které fungují pouze uvnitř těla (bloku kódu) nějakého cyklu: Příkaz continue; způsobí, že se přestane vykonávat tělo cyklu, a program bude pokračovat ve vykonávání na začátku cyklu (tedy u while na vyhodnocení výrazu). continue lze chápat jako skok na další iteraci cyklu. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int pocet = 0; while (pocet < 10) { pocet = pocet + 1; if (pocet < 5) { continue; } printf("Hodnota: %d\n", pocet); } return 0;
} Příkaz break; způsobí, že se cyklus přestane vykonávat a program začne vykonávat kód, který následuje za cyklem. Cyklus se tak zcela přeruší. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int pocet = 0; while (pocet < 10) { if (pocet * 2 > 12) { break; } printf("Hodnota: %d\n", pocet); pocet = pocet + 1; } return 0;
} Tip pro návrh cyklů while Příkaz break lze také někdy použít k usnadnění návrhu cyklů. Pokud potřebujete napsat while cyklus s nějakou složitou podmínkou ukončení, ze které se vám motá hlava, zkuste nejprve vytvořit "nekonečný" cyklus pomocí while (true) { … }, dále vytvořte tělo cyklu a až nakonec vymyslete podmínku, která cyklus ukončí pomocí příkazu break: #include <stdio.h> int main() { int pocet = 0; int pocet2 = 1; while (1) { printf("Hodnota: %d\n", pocet); pocet = pocet + 1; pocet2 += pocet * 2; if (pocet > 10) break; if (pocet2 > 64) break; } return 0;
} Nemusíte tak hned ze začátku vymýšlet výraz pro while, na čemž byste se mohli zaseknout. Místo while (true) můžete použít také while (1), protože 1 se při převodu na bool převede na true.

