Cyklus while má také alternativu zvanou do while. Tento cyklus má následující syntaxi: do { // tělo cyklu
}
while (<výraz typu bool>); Tento kód můžeme číst jako Prováděj <tělo cyklu>, dokud platí <výraz>. Jediný rozdíl mezi while a do while je ten, že v cyklu do while se výraz, který určuje, jestli se má provést další iterace cyklu, vyhodnocuje až na konci cyklu. Tělo cyklu tak bude pokaždé provedeno alespoň jednou (i kdyby byl výraz od začátku nepravdivý). Pokud pro to nemáte zvláštní důvod, asi není třeba tento typ cyklu používat.

